“I am at peace with myself knowing that I am more than an athlete.” 

@alexmorgan13 may be one of the world’s most gifted soccer players, but that’s not how she defines herself. As she prepares for her the inaugural season of San Diego Wave FC, the forward is also focusing on creating a home for her family. As a mom to 2-year-old Charlie, Alex knows that a home is more than a place to sleep—it is a center of gravity and love in her busy life.

